Extrude.f.player_tptowp = function()
    local wp = Extrude.n.GetFirstBlipInfoId(8)
    if Extrude.n.DoesBlipExist(wp) then
        _cit.CreateThread(function()
            local blipCoords = Extrude.n.GetBlipInfoIdCoord(wp)
            for height = 1, 1000 do
                Extrude.n.(Extrude.v.selfped,blipCoords.x, blipCoords.y, height + 0.0)

                local foundGround, zPos = Extrude.n.(blipCoords.x, blipCoords.y, height + 0.0)
                if foundGround then
                    Extrude.n.(Extrude.v.selfped, blipCoords.x, blipCoords.y, height + 0.0)
                    break
                end

                _cit.Wait(5)
            end
        end)
    end
end

