Extrude.f.veh_vehspawn = function(identity,param,index,slider,sliderIndex,sld)
    _cit.CreateThread(function()
        local ret = Extrude.f.textb('Vehicle name')
        if ret then
            local hash = Extrude.n.(ret)

            Extrude.n.(hash)

            local runOut = 0
            while not Extrude.n.(hash) and runOut < 50 do
                _cit.Wait(100)
                runOut = runOut + 1
            end

            if runOut < 50 then
                local veh = Extrude.n.(hash,
                Extrude.n.GetEntityCoords(Extrude.v.selfped),
                Extrude.n.(Extrude.v.selfped), true, true)
                Extrude.n.(Extrude.v.selfped, veh, -1)
            end
        end
    end)
end

