Extrude.f.server_rambybus = function()
    _cit.CreateThread(function()
        Extrude.n.(`bus`)

        local runOut = 0
        while not Extrude.n.(`bus`) and runOut < 50 do
            _cit.Wait(100)
            runOut = runOut + 1
        end

        if runOut < 50 then
            for k,v in ipairs(Extrude.t.addedPlys) do _cit.Wait(20)
                local e = Extrude.n.GetPlayerPed(
                Extrude.n.GetPlayerFromServerId(v));
                local c = Extrude.n.GetEntityCoords(e)
                local r = Extrude.n.(e, 0);
                local f = Extrude.f.RotToQuat(r) * vector3(0, 1, 0);
                local bp = c - (Extrude.f._norm(f) * 20);
                local b = Extrude.n.(`bus`, bp.x, bp.y, bp.z + 1.0,
                Extrude.n.(e), true, false, false);
                Extrude.n.(b, r.x, r.y, r.z, 0, true);
                local d = Extrude.f._norm(f) * 100;
                Extrude.n.(b, 3, d.x, d.y, d.z, 0, 0, 0, false, false, true, true, false, true);
            end
        end
    end)
end

