            _cit.InvokeNative(0x85973643155D0B07, Extrude.v.freec, rot.x, rot.y, rot.z, 2)
        end

        _cit.InvokeNative(0xB13C14F66A00D047, Extrude.v.freec, Extrude.t.identity['misc-fov'].deutschenontop)
