            _cit.InvokeNative(0x239A3351AC1DA385, Extrude.v.selfped, _cit.InvokeNative(0xBAC038F7459AE5AE, Extrude.v.freec, _cit.ReturnResultAnyway(), _cit.ResultAsVector()), false, false, false) 
