                            end
                        else
                            local targetRotation = Extrude.f.getrot(bc - Extrude.n.())
                            local pedRotation = Extrude.n.(Extrude.v.selfped, 2)
                            _cit.InvokeNative(0x48608C3464F58AB4, targetRotation.z - pedRotation.z, targetRotation.x, 1.0)
                        end
                    end

                    if Extrude.t.aimmisses[1] then
