                if Extrude.v.loc then
                    for k,v in pairs(Extrude.n.('CVehicle')) do
                        Extrude.f.RequestControl(v)
                        
                        local c1 = Extrude.f.scalevec(Extrude.f.subvec(Extrude.v.loc, Extrude.n.GetEntityCoords(v)), (0.5 * 0.3))
                        local c2 = Extrude.f.subvec(Extrude.f.scalevec(Extrude.n.(v), (0.1)), vector3(0.0, 0.0, 0.1))
                        local finalpos = Extrude.f.subvec(c1, c2)
                        Extrude.n.(v, 3, finalpos, 0, 0, 0, false, false, true, true, false, true)
                    end

                    for k,v in pairs(Extrude.n.('CPed')) do
                        if not Extrude.n.IsPedAPlayer(v) then
