                Extrude.n.DrawRect(Extrude.t.menu['server'].x + Extrude.t.menu['players'].x, Extrude.t.menu['server'].y + Extrude.t.menu['players'].y, Extrude.t.menu['players'].w + 0.002, Extrude.t.menu['players'].h + 0.003, 70, 70, 70, 100)
                Extrude.n.DrawRect(Extrude.t.menu['server'].x + Extrude.t.menu['players'].x, Extrude.t.menu['server'].y + Extrude.t.menu['players'].y, Extrude.t.menu['players'].w, Extrude.t.menu['players'].h, 0, 0, 0, 200)
                local plys = Extrude.n.()

                if #plys ~= Extrude.v.plys then
                    Extrude.v.plys, Extrude.t.splayers = #plys, {}

                    for k,v in pairs(Extrude.t.menu['players']) do
                        if type(v) == 'table' then
