                        Extrude.n.GetPlayerFromServerId(svid)), 0, 23), identity = identity, opt = Extrude.f.checkbox, param = false, func = Extrude.f.server_ply_list, id = svid}
                        table.insert(Extrude.t.menu['players'], t)
