            if Extrude.t.identity['server-triggerlist'].param then
                Extrude.n.DrawRect(Extrude.t.menu['server'].x + Extrude.t.menu['triggers'].x, Extrude.t.menu['server'].y + Extrude.t.menu['triggers'].y, Extrude.t.menu['triggers'].w + 0.002, Extrude.t.menu['triggers'].h + 0.003, 70, 70, 70, 100)
                Extrude.n.DrawRect(Extrude.t.menu['server'].x + Extrude.t.menu['triggers'].x, Extrude.t.menu['server'].y + Extrude.t.menu['triggers'].y, Extrude.t.menu['triggers'].w, Extrude.t.menu['triggers'].h, 0, 0, 0, 200)
