                Extrude.v.click = true
            end

            Extrude.v.press, Extrude.v.sliderzz = false, nil
            for _k,_v in pairs(Extrude.t.menu) do
                local isShit = _k == 'players' and Extrude.t.identity['server-plylist'].param or _k == 'triggers' and Extrude.t.identity['server-triggerlist'].param
                if _v.show or isShit  then
                    if _v.title then
                        Extrude.f.drawtext(string.upper(_v.title), _v.x, _v.y - 0.0185, 4, 0.5, true, 255, 255, 255, 255, true)
                        Extrude.n.DrawSprite('mpentry', 'mp_modenotselected_gradient', _v.x, _v.y, _v.w + 0.06, _v.h + 0.02, 0.0, 255, 255, 255, 255)
                        Extrude.n.DrawSprite('mpentry', 'mp_modenotselected_gradient', _v.x, _v.y, _v.w + 0.06, _v.h + 0.02, 0.0, 255, 255, 255, 255)
