                                    if _k == 'main' then
                                        y = _v.y - 0.1375 + 0.0402 * _v.options
                                        Extrude.n.DrawRect(_v.x, y + 0.028, 0.008, 0.003, Extrude.t.menu[v.param].show and Extrude.t.identity['opts-menur'].sldcolor[1] or 200, Extrude.t.menu[v.param].show and Extrude.t.identity['opts-menur'].sldcolor[2] or 200, Extrude.t.menu[v.param].show and Extrude.t.identity['opts-menur'].sldcolor[3] or 200, 255)
                                    elseif _k == 'players' or _k == 'triggers' then
                                        x, y = Extrude.t.menu['server'].x + Extrude.t.menu[_k].x - 0.045, Extrude.t.menu['server'].y + Extrude.t.menu[_k].y - 0.22 + 0.021 * _v.actOps
                                    else
                                        x, y = _v.x - 0.075, _v.y + 0.025 + 0.021 * _v.actOps
                                    end

                                    local ret = v.opt(_k, k, v.title, x, y, v.param)
                                    if ret then
                                        if ret == 'checkbox' then
                                            v.param = not v.param
                                        end

                                        if v.func then
                                            v.func(v.identity, v.param, v.index, v.slideropts, v.deutschenontop, v.sld)
                                        end
                                    end
                                    _v.actOps = _v.actOps + 1
                                end

                                _v.options = _v.options + 1
                            end
                        end
                        if _v.options > _v.scrollo2 + 1 and not isShit then
                            Extrude.v.scollin = false
                            local a = (0.0208 * _v.actOps)
                            local s = _v.actOps/_v.options * a
                            local drawposY = _v.y + 0.029 + s/2 + (a-s) * (_v.scrollo)/(_v.options - _v.scrollo2 - 1)
                            Extrude.n.DrawRect(_v.x + 0.0817, _v.y + 0.029 + a/2, 0.0022, a, 0, 0, 0, 200)
                            Extrude.n.DrawRect(_v.x + 0.0817, drawposY, 0.0022, s, 150, 150, 150, 255)
                            local bounds = Extrude.f.bounds(_v.x + 0.0817, drawposY, 0.0022, s)

                            if not Extrude.v.holdslider then
                                local cont = Extrude.f.tablecontains(Extrude.t.holdScroll, _k)

                                if Extrude.v.pressing and (bounds or cont) then
                                    if not cont then
                                        table.insert( Extrude.t.holdScroll, _k );
                                    end

                                    local y = Extrude.f.clamp(0, a - s, Extrude.v.relcy - (_v.y + 0.029 + s/2))
                                    _v.scrollo = math.floor((y/(a-s)) * (_v.options - _v.scrollo2 - 1))

                                    Extrude.v.scollin = true
                                elseif cont and not Extrude.v.pressing or bounds then
                                    local found = Extrude.f.tablefind(Extrude.t.holdScroll, _k)
                                    if found ~= false then
                                       table.remove(Extrude.t.holdScroll, found);
                                    end
                                end
                            end
                        end
                        if not Extrude.v.hoveringcombo and Extrude.f.bounds(isShit and Extrude.t.menu['server'].x + _v.x or _v.x, (isShit and Extrude.t.menu['server'].y + _v.y or _v.y) + (0.021 * _v.actOps)/2, _v.w, _v.h + 0.021 * _v.actOps) then
                            if Extrude.n.IsDisabledControlJustPressed(0, 16) then
                                _v.scrollo = _v.scrollo + 1
                                _v.scrollo = Extrude.f.clamp(0, _v.options - _v.scrollo2 - 1, _v.scrollo)
                            elseif Extrude.n.IsDisabledControlJustPressed(0, 17) then
                                _v.scrollo = _v.scrollo - 1
                                _v.scrollo = Extrude.f.clamp(0, _v.options - _v.scrollo2 - 1, _v.scrollo)
                            end
                        end
                    end
                end
            end

            if not Extrude.v.press and not Extrude.v.holdslider and Extrude.n.IsDisabledControlJustPressed(0, 24, true) then
                if Extrude.f.bounds(Extrude.t.menu['main'].x, Extrude.t.menu['main'].y, Extrude.t.menu['main'].w, Extrude.t.menu['main'].h) then
                    Extrude.v.dragging = Extrude.t.menu['main']
                elseif Extrude.v.write and Extrude.f.bounds(Extrude.v.txtx, Extrude.v.txty, 0.15, 0.26) then
                    Extrude.v.dragging = {x = Extrude.v.txtx, y = Extrude.v.txty}
                elseif Extrude.f.bounds(Extrude.t.menu['player'].x, Extrude.t.menu['player'].y, Extrude.t.menu['player'].w, Extrude.t.menu['player'].h) then
                    Extrude.v.dragging = Extrude.t.menu['player']
                elseif Extrude.f.bounds(Extrude.t.menu['car'].x, Extrude.t.menu['car'].y, Extrude.t.menu['car'].w, Extrude.t.menu['car'].h) then
                    Extrude.v.dragging = Extrude.t.menu['car']
                elseif Extrude.f.bounds(Extrude.t.menu['weapon'].x, Extrude.t.menu['weapon'].y, Extrude.t.menu['weapon'].w, Extrude.t.menu['weapon'].h) then
                    Extrude.v.dragging = Extrude.t.menu['weapon']
                elseif Extrude.f.bounds(Extrude.t.menu['visuals'].x, Extrude.t.menu['visuals'].y, Extrude.t.menu['visuals'].w, Extrude.t.menu['visuals'].h) then
                    Extrude.v.dragging = Extrude.t.menu['visuals']
                elseif Extrude.f.bounds(Extrude.t.menu['server'].x, Extrude.t.menu['server'].y, Extrude.t.menu['server'].w, Extrude.t.menu['server'].h) then
                    Extrude.v.dragging = Extrude.t.menu['server']
                elseif Extrude.f.bounds(Extrude.t.menu['misc'].x, Extrude.t.menu['misc'].y, Extrude.t.menu['misc'].w, Extrude.t.menu['misc'].h) then
                    Extrude.v.dragging = Extrude.t.menu['misc']
                elseif Extrude.f.bounds(Extrude.t.menu['options'].x, Extrude.t.menu['options'].y, Extrude.t.menu['options'].w, Extrude.t.menu['options'].h) then
                    Extrude.v.dragging = Extrude.t.menu['options']
                elseif Extrude.f.bounds(Extrude.t.menu['server'].x + Extrude.t.menu['players'].x, Extrude.t.menu['server'].y + Extrude.t.menu['players'].y, Extrude.t.menu['players'].w, Extrude.t.menu['players'].h) then
                    Extrude.v.dragging = Extrude.t.menu['players']
                elseif Extrude.f.bounds(Extrude.t.menu['server'].x + Extrude.t.menu['triggers'].x, Extrude.t.menu['server'].y + Extrude.t.menu['triggers'].y, Extrude.t.menu['triggers'].w, Extrude.t.menu['triggers'].h) then
                    Extrude.v.dragging = Extrude.t.menu['triggers']
                end

                if Extrude.v.dragging then
                    Extrude.v.ox = Extrude.v.dragging.x - Extrude.v.relcx
                    Extrude.v.oy = Extrude.v.dragging.y - Extrude.v.relcy

                    if Extrude.n.GetGameTimer() <= (Extrude.v.dragTimer or 0) then
                        Extrude.v.dragging.closed = not Extrude.v.dragging.closed
                    end
                end
            elseif Extrude.v.dragging and Extrude.n.IsDisabledControlJustReleased(0, 24, true) then
                if Extrude.v.write then Extrude.v.txtx, Extrude.v.txty = Extrude.v.dragging.x, Extrude.v.dragging.y end
                Extrude.v.dragging = nil
                Extrude.v.dragTimer = Extrude.n.GetGameTimer() + 100
            end

            if Extrude.v.dragging then
                Extrude.v.dragging.x = Extrude.v.relcx + Extrude.v.ox
                Extrude.v.dragging.y = Extrude.v.relcy + Extrude.v.oy
                if Extrude.v.write then Extrude.v.txtx, Extrude.v.txty = Extrude.v.dragging.x, Extrude.v.dragging.y end
            end

            Extrude.v.hoveringcombo = false
        end
    end
end)

Extrude.f.skels = function(ped, color)
