    local rightknee = Extrude.n.(ped, 0x3FCF, 0.0, 0.0, 0.0, o);
    local leftknee = Extrude.n.(ped, 0xB3FE, 0.0, 0.0, 0.0, o);
    local neck = Extrude.n.(ped, 0x9995, 0.0, 0.0, 0.0, o);
    local head = Extrude.n.(ped, 0x796E, 0.0, 0.0, 0.0, o);
    local pelvis = Extrude.n.(ped, 0x2E28, 0.0, 0.0, 0.0, o);
    local rightFoot = Extrude.n.(ped, 0xCC4D, 0.0, 0.0, 0.0, o);
    local leftFoot = Extrude.n.(ped, 0x3779, 0.0, 0.0, 0.0, o);
    local rightUpperArm = Extrude.n.(ped, 0x9D4D, 0.0, 0.0, 0.0, o);
    local leftUpperArm = Extrude.n.(ped, 0xB1C5, 0.0, 0.0, 0.0, o);
    local rightForeArm = Extrude.n.(ped, 0x6E5C, 0.0, 0.0, 0.0, o);
    local leftForeArm = Extrude.n.(ped, 0xEEEB, 0.0, 0.0, 0.0, o);
    local rightHand = Extrude.n.(ped, 0xDEAD, 0.0, 0.0, 0.0, o);
    local leftHand = Extrude.n.(ped, 0x49D9, 0.0, 0.0, 0.0, o);
    Extrude.n.DrawLine(head, neck, color.r, color.g, color.b, color.a)
    Extrude.n.DrawLine(neck, pelvis, color.r, color.g, color.b, color.a)
    Extrude.n.DrawLine(pelvis, rightknee, color.r, color.g, color.b, color.a)
