Extrude.f.box = function(ped, color)
    local top = Extrude.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, 1.0)
    local bottom = Extrude.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, -1.0)

    local ret, sx, sy = Extrude.n.GetScreenCoordFromWorldCoord(top.x, top.y, top.z)
    local ret2, sx2, sy2 = Extrude.n.GetScreenCoordFromWorldCoord(bottom.x, bottom.y, bottom.z)

    if ret and ret2 then
        local x = (sy - sy2) / 4
        Extrude.n.DrawRect(0 + x / 2, 0, 1 / Extrude.v.rx, sy - sy2, color.r, color.g, color.b, color.a)
        Extrude.n.DrawRect(0 - x / 2, 0, 1 / Extrude.v.rx, sy - sy2, color.r, color.g, color.b, color.a)

        local y = sy - sy2
        Extrude.n.DrawRect(0, 0 + y / 2, (sy - sy2) / 4, 1 / Extrude.v.ry, color.r, color.g, color.b, color.a)
        Extrude.n.DrawRect(0, 0 - y / 2, (sy - sy2) / 4, 1 / Extrude.v.ry, color.r, color.g, color.b, color.a)
    end
end

Extrude.f.boxfill = function(ped, color)
    local top = Extrude.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, 1.0)
    local bottom = Extrude.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, -1.0)

    local ret, sx, sy = Extrude.n.GetScreenCoordFromWorldCoord(top.x, top.y, top.z)
    local ret2, sx2, sy2 = Extrude.n.GetScreenCoordFromWorldCoord(bottom.x, bottom.y, bottom.z)

    if ret and ret2 then
        Extrude.n.DrawRect(0, 0, (sy - sy2) / 4, sy - sy2, color.r, color.g, color.b, color.a)
    end
