Extrude.f.healthbar = function(ped, color)
    local top = Extrude.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, 1.0)
    local bottom = Extrude.n.GetOffsetFromEntityInWorldCoords(ped, 0, 0, -1.0)

    local h =  (Extrude.n.(ped)-100)/(Extrude.n.(ped) - 100)
    local ph = Extrude.f.clamp(0, 1, h)

    local ret, sx, sy = Extrude.n.GetScreenCoordFromWorldCoord(top.x, top.y, top.z)
    local ret2, sx2, sy2 = Extrude.n.GetScreenCoordFromWorldCoord(bottom.x, bottom.y, bottom.z)

    if ret and ret2 then
        local x = 0 + (sy - sy2) / 4 / 2 - 2 / Extrude.v.rx
        local pixel = 1 / Extrude.v.rx
        local y = sy - sy2
        Extrude.n.DrawRect(x, 0, pixel, y, 0, 0, 0, 255)
        Extrude.n.DrawRect(x, 0 - y/2 + (y*ph - pixel)/2, pixel, -1* y*ph + pixel, color.r, color.g, color.b, color.a)
    end
end

