Extrude.f.visuals = function()
    if Extrude.t.identity['vis-enable'].param then
        for i=1, #Extrude.v.peds do
            local ped = Extrude.v.peds[i];
            if (ped) and (Extrude.n.(ped))
            and (Extrude.t.identity['vis-npc'].param or Extrude.n.IsPedAPlayer(ped)) and (ped ~= Extrude.v.selfped or Extrude.t.identity['vis-self'].param) and
            (not Extrude.t.identity['vis-onlyalive'].param or Extrude.n.(ped) > 0) then
                local dist = Extrude.n.(Extrude.v.selfcoords, Extrude.n.GetEntityCoords(ped, true));
                local maxdist = 150;
                if Extrude.t.identity['vis-dist_enable'].param then
                    maxdist = Extrude.t.identity['vis-dist_val'].deutschenontop;
                end
                if dist < maxdist then
                    if Extrude.t.identity['vis-lines'].param then
                        Extrude.f.lines(ped, Extrude.t.identity['vis-lines'].color)
                    end

                    if Extrude.n.(ped) then
                        if Extrude.t.identity['vis-skel'].param then
                            Extrude.f.skels(ped, {r = 255, g = 255, b = 255, a = 255})
                        end

                        if Extrude.t.identity['vis-boundingbox'].param then
                            Extrude.f.boundbox(ped, {r = 255, g = 255, b = 255, a = 255})
                        end

                        if Extrude.t.identity['vis-fboundingbox'].param then
                            Extrude.f.boundboxfill(ped, Extrude.t.identity['vis-fboundingbox'].color)
                        end
                        
                        if #Extrude.t.carsfreecams <= 31 and (Extrude.t.identity['vis-box'].param or Extrude.t.identity['vis-fillbox'].param or Extrude.t.identity['vis-text'].param or Extrude.t.identity['vis-hbar'].param or Extrude.t.identity['vis-abar'].param) then
                            table.insert(Extrude.t.carsfreecams, ped)
                        end
                    end
                end
            end
        end
    end
end

Extrude.v.prevfov = 0.0

Extrude.f.fovpoints = function()
    Extrude.v.polypoints = {}
    for i = 1, 360 do
        local x = math.cos(math.rad(i)) / Extrude.v.rx
        local y = math.sin(math.rad(i)) / Extrude.v.ry
        local sx, sy = x * Extrude.t.identity['aim-fov'].deutschenontop, y * Extrude.t.identity['aim-fov'].deutschenontop
        Extrude.v.polypoints[#Extrude.v.polypoints + 1] = {
            x = sx + 0.5,
            y = sy + 0.5
        }
    end
end

Extrude.f.pedInfov = function(fx,fy)
    for i = 1, 180 do
        if math.abs(fx - 0.5) < math.abs( (Extrude.v.polypoints[i].x - Extrude.v.polypoints[i+180].x) / 2 ) and math.abs(fy - 0.5) < math.abs( (Extrude.v.polypoints[i].y - Extrude.v.polypoints[i+180].y) / 2 ) then
            return true
        end
    end
    return false
end

Extrude.f.aimbotPed = function()
    local dist, ent, sret, ssx, ssy, bc = 10000000, nil
    for i=1, #Extrude.v.peds do
        local ped = Extrude.v.peds[i];
        if ped ~= Extrude.v.selfped and Extrude.n.(ped) > 0 and Extrude.n.(Extrude.v.selfped, ped, 17) then
            local c = Extrude.n.(ped, Extrude.t.aimbones[Extrude.t.identity['aim-bone'].index]);
            local os, sx, sy = Extrude.n.GetScreenCoordFromWorldCoord(c.x, c.y, c.z);

            local dista = #vector2(sx - 0.5, sy - 0.5)

            if dista < dist then
                dist, ent, sret, ssx, ssy, bc = dista, ped, os, sx, sy, c
            end
        end
    end

    return ent, sret, ssx, ssy, bc
end

Extrude.f.drawFOV = function()
    local r = (Extrude.v.polypoints[1].x - Extrude.v.polypoints[180].x)
    Extrude.n.DrawSprite('mpmissmarkers256','corona_shade', 0.5, 0.5, r, r * (Extrude.v.rx/Extrude.v.ry), 0.0, 0, 0, 0, Extrude.t.identity['aim-fov-draw-alpha'].deutschenontop)
end

Extrude.f.textb = function(title, tablaa)
    Extrude.v.write = true
    local stringz = ''
    local strleng = {[22] = false, [45] = false, [68] = false, [91] = false}
    local txtWidth =Extrude.f.textwidth(title, 0.5)

    while Extrude.v.write do _cit.Wait(0)
        Extrude.n.DisableAllControlActions(0)
        local button = nil

        for i = 1, 357 do
            if (Extrude.n.IsDisabledControlJustPressed(0, i, true) or
            (Extrude.n.IsDisabledControlPressed(0, i, true) and
            Extrude.n.GetGameTimer() >= (Extrude.v.txtboxwait or 0))) and i ~= 239
            and i ~= 240
            and i ~= 21
            and i ~= 18
            and i ~= 131
            and i ~= 61
            and i ~= 155
            and i ~= 209
            and i ~= 254
            and i ~= 258
            and i ~= 340
            and (Extrude.v.finished or string.len(stringz) < 1) then
                button, Extrude.v.txtboxwait = Extrude.n.(0, i, 0),
                Extrude.n.GetGameTimer() + 150
            end
        end

        if button then
            button = button == 'b_2000' and ' ' or string.gsub(button, "b_", "")
            button = string.gsub(button, "t_", "")
            if string.find(button, '%', 1, true) then button = string.sub(button, 1, 1) end

            if string.len(button) <= 1 then
                stringz = Extrude.n.IsDisabledControlPressed(0, 21, true) and (Extrude.t.txtupper[button] and stringz .. Extrude.t.txtupper[button] or stringz .. button) or stringz .. string.lower(button)
            end

            for k,v in pairs(strleng) do
                if k <= string.len(stringz) and not v then
                    strleng[k] = true
                    stringz = string.sub(stringz, 0, k) .. '\n' .. string.sub(stringz, k, string.len(stringz))
                end
            end
        end

        Extrude.n.DrawRect(0.5, 0.5, 1.0, 1.0, 0, 0, 0, 80)

        if Extrude.v.finished then
            Extrude.f.drawtext(title, Extrude.v.txtx - 0.05, Extrude.v.txty - 0.1, 4, 0.5, false, 255, 255, 255, 255, true)
            Extrude.n.DrawRect(Extrude.v.txtx, Extrude.v.txty + 0.02, 0.15, 0.26, 0, 0, 0, 200)
            Extrude.n.DrawRect(Extrude.v.txtx, Extrude.v.txty + 0.03, 0.14, 0.22, 30, 30, 30, 230)
            Extrude.n.DrawRect(Extrude.v.txtx - 0.07, Extrude.v.txty + 0.03, 0.0005, 0.22, Extrude.t.identity['opts-menur'].sldcolor[1], Extrude.t.identity['opts-menur'].sldcolor[2] - 25, Extrude.t.identity['opts-menur'].sldcolor[3], 230)
            Extrude.n.DrawRect(Extrude.v.txtx + 0.07, Extrude.v.txty + 0.03, 0.0005, 0.22, Extrude.t.identity['opts-menur'].sldcolor[1], Extrude.t.identity['opts-menur'].sldcolor[2] - 25, Extrude.t.identity['opts-menur'].sldcolor[3], 230)
            Extrude.n.DrawRect(Extrude.v.txtx, Extrude.v.txty + 0.14, 0.14, 0.001, Extrude.t.identity['opts-menur'].sldcolor[1], Extrude.t.identity['opts-menur'].sldcolor[2] - 25, Extrude.t.identity['opts-menur'].sldcolor[3], 230)
            Extrude.n.DrawRect(Extrude.v.txtx - 0.06, Extrude.v.txty - 0.08, 0.02, 0.001, Extrude.t.identity['opts-menur'].sldcolor[1], Extrude.t.identity['opts-menur'].sldcolor[2] - 25, Extrude.t.identity['opts-menur'].sldcolor[3], 230)
            Extrude.n.DrawRect(Extrude.v.txtx + txtWidth / 2 + 0.01, Extrude.v.txty - 0.08, 0.12 - txtWidth, 0.001, Extrude.t.identity['opts-menur'].sldcolor[1], Extrude.t.identity['opts-menur'].sldcolor[2] - 25, Extrude.t.identity['opts-menur'].sldcolor[3], 230)
            Extrude.f.drawtext(stringz, Extrude.v.txtx - 0.06, Extrude.v.txty - 0.06, 0, 0.28, false, 255, 255, 255, 255)
        else
