            Extrude.n.DrawRect(Extrude.v.txtx, Extrude.v.txty + 0.02, 0.15, 0.1, 0, 0, 0, 200)
            Extrude.n.DrawRect(Extrude.v.txtx, Extrude.v.txty + 0.03, 0.14, 0.06, 30, 30, 30, 230)
            Extrude.n.DrawRect(Extrude.v.txtx - 0.07, Extrude.v.txty + 0.03, 0.0005, 0.062, Extrude.t.identity['opts-menur'].sldcolor[1], Extrude.t.identity['opts-menur'].sldcolor[2] - 25, Extrude.t.identity['opts-menur'].sldcolor[3], 230)
            Extrude.n.DrawRect(Extrude.v.txtx + 0.07, Extrude.v.txty + 0.03, 0.0005, 0.062, Extrude.t.identity['opts-menur'].sldcolor[1], Extrude.t.identity['opts-menur'].sldcolor[2] - 25, Extrude.t.identity['opts-menur'].sldcolor[3], 230)
            Extrude.n.DrawRect(Extrude.v.txtx, Extrude.v.txty + 0.06, 0.14, 0.001, Extrude.t.identity['opts-menur'].sldcolor[1], Extrude.t.identity['opts-menur'].sldcolor[2] - 25, Extrude.t.identity['opts-menur'].sldcolor[3], 230)
