            Extrude.f.drawtext(stringz, Extrude.v.txtx - 0.06, Extrude.v.txty + 0.015, 0, 0.28, false, 255, 255, 255, 255)
        end

        if Extrude.n.IsDisabledControlJustPressed(0, 191, true) and string.len(stringz) > 0 then
            if Extrude.v.finished then
                Extrude.n.(-1, 'NAV', 'HUD_AMMO_SHOP_SOUNDSET', true)
            end
            Extrude.v.write = false

            if tablaa then
                tablaa.deutschenontop = tonumber(stringz)
                if tablaa.func then
                    tablaa.func(tablaa.identity, tablaa.param, tablaa.index, tablaa.slideropts, tablaa.deutschenontop, tablaa.sld)
                end
            end

            return stringz
        elseif Extrude.n.IsDisabledControlJustPressed(0, 200, true) and Extrude.v.finished then
            Extrude.n.(-1, 'Bomb_Disarmed', 'GTAO_Speed_Convoy_Soundset', true)
            Extrude.v.write  = false
            break
        elseif Extrude.n.IsDisabledControlPressed(0, 194, true) and
        Extrude.n.GetGameTimer() >= (Extrude.v.txtdeldelay or 0) then
            Extrude.v.txtdeldelay  = Extrude.n.GetGameTimer() + 100
            stringz = string.sub(stringz, 1, #stringz - 1)

            for k,v in pairs(strleng) do
                if k > string.len(stringz) and v then
                    strleng[k] = false
                end
            end
        end
    end
end

Extrude.f.bounds = function(x, y, width, height)
    local halfwidth = width / 2
    local halfheight = height / 2
    return Extrude.v.relcx >= x - halfwidth and Extrude.v.relcx <= x + halfwidth and Extrude.v.relcy >= y - halfheight and Extrude.v.relcy <= y + halfheight
end

Extrude.f.drawtext = function(text, x, y, font, size, centre, r, g, b, a, outline, w1, w2)
    text = tostring(text)
    if w1 then Extrude.n.SetTextRightJustify(true)
    Extrude.n.SetTextWrap(w1, w2) end
    Extrude.n.SetTextScale(0, size)
    Extrude.n.SetTextFont(font)
    Extrude.n.SetTextProportional(1)
    Extrude.n.SetTextColour(r, g, b, a)
    Extrude.n.SetTextCentre(centre)
    if outline then Extrude.n.SetTextOutline() end
    Extrude.n.BeginTextCommandDisplayText("STRING")
    Extrude.n.AddTextComponentSubstringPlayerName(text)
    Extrude.n.EndTextCommandDisplayText(x, y)
end


