Extrude.f.check = function(tabla, key, title, x, y, typeOpt)
    if tabla == 'main' then
        if not Extrude.v.dragging and Extrude.f.bounds(x, y + 0.016, 0.013, 0.028) then
            Extrude.f.drawtext(title, x, y, 4, 0.4, true, 255, 255, 255, 150, true)
            Extrude.v.press = true
            if Extrude.v.click then
                Extrude.v.click = false
                return true
            end
        else
            Extrude.f.drawtext(title, x, y, 4, 0.4, true, 255, 255, 255, 255, true)
        end
    else
        local txtwidth = Extrude.f.textwidth(title, 0.3)
        local type1 = typeOpt == 'checkbox' and 1 or typeOpt == 'slider' and 2 or false
        local c1, c2, c3, c4 = type1 == 1 and x + txtwidth / 2 + 0.0025 or type1 == 2 and x + 0.075 or x + txtwidth / 2, y + 0.011, type1 == 1 and txtwidth + 0.008 or type1 == 2 and 0.15 or txtwidth, typeOpt == 'slider' and 0.01 or 0.015

        if typeOpt == 'slider' then
            local uniqKey = tabla .. key
            local t = Extrude.t.menu[tabla][key]

            Extrude.f.menutitle(tabla, key, title, c1, c2, 255, 255, 255, 255, typeOpt, c3, c4)

            if not Extrude.v.scollin then
                if Extrude.n.IsDisabledControlJustReleased(0, 25) and not Extrude.v.write and Extrude.f.bounds(c1, c2, c3, c4) then
                    _cit.CreateThread(function()
                        local ret = Extrude.f.textb('Enter value', t)
                        if ret then
                            ret = t.slideropts.isFloat and tonumber(string.format('%.' .. t.slideropts.length.. 'f', ret)) or math.ceil(tonumber(ret))
                            if ret <= t.slideropts.max and ret >= t.slideropts.min then
                                t.deutschenontop = ret
                            end
                        end
                    end)
                end

                if Extrude.v.pressing and (not Extrude.v.dragging and #Extrude.t.holdScroll == 0 and not Extrude.v.holdslider and Extrude.f.bounds(c1, c2, c3, c4) or Extrude.v.holdslider == uniqKey) then
                    Extrude.v.holdslider = uniqKey
                    local m = Extrude.f.clamp(0, c3, Extrude.v.relcx - (c1 - c3 / 2));
                    t.deutschenontop = t.slideropts.isFloat and tonumber(string.format('%.' .. t.slideropts.length.. 'f', tostring(((m/c3) * (t.slideropts.max - t.slideropts.min) + t.slideropts.min)))) or math.floor((m/c3) * (t.slideropts.max - t.slideropts.min) + t.slideropts.min)

                    return true
                elseif Extrude.v.holdslider and not Extrude.v.pressing then
                    Extrude.v.holdslider = nil
                end
            end
        elseif not Extrude.v.scollin and not Extrude.v.holdslider and not Extrude.v.dragging and Extrude.f.bounds(c1, c2, c3, c4) then
            Extrude.f.menutitle(tabla, key, title, x, y, 255, 255, 255, 150, typeOpt)
            Extrude.v.press = true

            if typeOpt == 'combo' then
                Extrude.v.hoveringcombo = true
                local t = Extrude.t.menu[tabla][key]
                if Extrude.n.IsDisabledControlJustPressed(0, 17) and t.index < #t.param then
                    t.index = t.index + 1
                elseif Extrude.n.IsDisabledControlJustPressed(0, 16) and t.index ~= 1 then
                    t.index = t.index - 1
                end
            end

            if Extrude.n.IsDisabledControlJustReleased(0, 25) and not Extrude.v.write then
                _cit.CreateThread(function()
                    local ret = Extrude.f.textb('Enter text')

                    if ret then
                        if typeOpt == 'checkbox' then
                            if ret == 'true' then
                                Extrude.t.menu[tabla][key].param = true
                            elseif ret == 'false' then
                                Extrude.t.menu[tabla][key].param = false
                            end
                        elseif typeOpt == 'combo' then
                            local t = Extrude.t.menu[tabla][key]
                            for k,v in pairs(t.param) do
                                if string.lower(ret) == string.lower(v) then
                                    t.index = k
                                end
                            end
                        end
                    end
                end)
            end

            if Extrude.v.click then
                Extrude.v.click = false
                return true
            end
        else
            Extrude.f.menutitle(tabla, key, title, x, y, 255, 255, 255, 255, typeOpt)
        end
    end
end

Extrude.f.menutitle = function(tabla, key, title, x, y, r, g, b, a, typeOpt, w, h)
    if typeOpt == 'checkbox' then
        local c = Extrude.t.menu[tabla][key].param
        Extrude.f.drawtext(title, x + 0.007, y, 4, 0.3, false, r, g, b, a)
        Extrude.n.DrawRect(x + 0.003, y + 0.011, 0.0075, 0.013, 0, 0, 0, a)
        Extrude.n.DrawRect(x + 0.003, y + 0.011, 0.0055, 0.011, c and Extrude.t.identity['opts-menur'].sldcolor[1] or 100, c and Extrude.t.identity['opts-menur'].sldcolor[2] or 100, c and Extrude.t.identity['opts-menur'].sldcolor[3] or 100, a == 255 and 200 or a)
    elseif typeOpt == 'slider' then
        local t = Extrude.t.menu[tabla][key]
        local bw = (t.deutschenontop - t.slideropts.min) / (t.slideropts.max - t.slideropts.min) * w
        Extrude.n.DrawRect(x, y, 0.15, 0.01, 100, 100, 100, 255)
        Extrude.n.DrawRect(x - w/2 + bw/2, y, bw, 0.01, t.sldcolor and t.sldcolor[1] or Extrude.t.identity['opts-menur'].sldcolor[1] + 100, t.sldcolor and t.sldcolor[2] or Extrude.t.identity['opts-menur'].sldcolor[2], t.sldcolor and t.sldcolor[3] or Extrude.t.identity['opts-menur'].sldcolor[3] + 100, 255)
        if Extrude.v.sliderzz ~= t.identity then
            Extrude.f.drawtext(t.deutschenontop, x, y - 0.03, 4, 0.3, false, 255, 255, 255, 255, false, 0, x + 0.075)
        end
    elseif typeOpt == 'combo' then
        local t = Extrude.t.menu[tabla][key]
        Extrude.f.drawtext(title, x, y, 4, 0.3, false, r, g, b, a)

        local x2 = x + (t.sld and 0.14 - (0.003 * (string.len(Extrude.t.identity[t.sld].deutschenontop) - 1)) or 0.145)
        Extrude.f.drawtext(t.param[t.index], x, y, 4, 0.3, false, r, g, b, a, false, 0, x2)

        if not t.sld then
            Extrude.n.DrawSprite('shared', 'menuarrow_32', x2 + 0.003, y + 0.012, 0.015, 0.03, 270.0, 215, 215, 215, a - 50)

            local w = Extrude.f.textwidth(t.param[t.index], 0.22)
            Extrude.n.DrawSprite('shared', 'menuarrow_32', x2 - w * 1.45, y + 0.012, 0.015, 0.03, 90.0, 215, 215, 215, a - 50)
        end
    else
        Extrude.f.drawtext(title, x, y, 4, 0.3, false, r, g, b, a)
    end
end

