Extrude.f.RotToQuat = function(rot) local pitch, roll, yaw = math.rad(rot.x), math.rad(rot.y), math.rad(rot.z); local cy, sy, cr, sr, cp, sp = math.cos(yaw   * 0.5), math.sin(yaw   * 0.5), math.cos(roll  * 0.5), math.sin(roll  * 0.5), math.cos(pitch * 0.5), math.sin(pitch * 0.5); return quat(cy * cr * cp + sy * sr * sp, cy * sp * cr - sy * cp * sr, cy * cp * sr + sy * sp * cr, sy * cr * cp - cy * sr * sp) end
